import React from 'react';

function BasicDining(){
    return(
        <nav className="centered-layout">
            <h1 className="title">Basic Dining Calculation</h1>
            <p>
                Basic Dining Caluculation Coming Soon!
            </p>
            <a href="/calculate-home">
                <button className="btn btn-primary">Go Back</button><br/>
            </a>
        </nav>
    )
}

export default BasicDining;
